import React from 'react';

const Item = ({item}) => {
  const {id,name,data,img} = item;
  return (
    <div>
      <div className="cards">
        <div className="image_box">
          <img src={img} alt="" />
        </div>
        <div className="details">
          <p>{id}</p>
          <p>{data}</p>
          <p>{name}</p>
        </div>
        <button className='card_btn'>BUY</button>
      </div>
    </div>
  );
};

export default Item;
